package com.forestar.cache.jobs;

public class JobRecord {
	
	
	private String layerName;
	
	private String datasetName;
	//oid
	private String indexIdx;

	private String col;
	
	private String row;
	
	public String getLayerName() {
		return layerName;
	}

	public void setLayerName(String layerName) {
		this.layerName = layerName;
	}

	public String getDatasetName() {
		return datasetName;
	}

	public void setDatasetName(String datasetName) {
		this.datasetName = datasetName;
	}

	public String getIndexIdx() {
		return indexIdx;
	}

	public void setIndexIdx(String indexIdx) {
		this.indexIdx = indexIdx;
	}
	
	

	public String getCol() {
		return col;
	}

	public void setCol(String col) {
		this.col = col;
	}

	public String getRow() {
		return row;
	}

	public void setRow(String row) {
		this.row = row;
	}

	@Override
	public String toString() {
		return "JobRecord [layerName=" + layerName + ", datasetName="
				+ datasetName + ", indexIdx=" + indexIdx + ", col=" + col
				+ ", row=" + row + "]";
	}

}
